import React,{Component} from 'react';
import {variables} from './Variables.js';

export class Machine extends Component{

    constructor(props){
        super(props);

        this.state={
            machines:[]
        }
    }

    render(){
        return(
            <div>
                <table className='table table-striped'>
                    <thead>
                        <tr>
                            <th>
                                MachineId
                            </th>
                            <th>
                                MachineName
                            </th>
                            <th>
                                MachineClass
                            </th>
                            <th>
                                MachineCompany
                            </th>
                        </tr>
                    </thead>
                </table>
            </div>
        )
    }
}
